import { createSlice, PayloadAction } from '@reduxjs/toolkit';
import { RootState } from '../../store';
import { Movie } from '../../../../definitions/types';

interface MoviesState {
  selected: string | undefined;
  movies: Movie[];
}

const initialState: MoviesState = {
  selected: undefined,
  movies: [
    {
      title: 'Hola',
      id: '1',
      release: new Date().toLocaleDateString(),
      description: 'description',
      image:
        '',
    },
  ],
};

export const moviesSlice = createSlice({
  name: 'movie',
  initialState,
  reducers: {
    addMovie: (state, action: PayloadAction<Movie>) => {
      state.movies.push(action.payload);
    },
    removeMovie: (state, action: PayloadAction<string>) => {
      state.movies = state.movies.filter(({ id }) => id !== action.payload);
    },
    selectMovie: (state, action: PayloadAction<string>) => {
      state.selected = action.payload;
    },
  },
});

export const { addMovie, removeMovie, selectMovie } = moviesSlice.actions;

export const allMovies = (state: RootState) => state.movies.movies;
export const selectedMovie = (state: RootState) => {
  const {
    movies: { selected, movies },
  } = state;
  return movies.find(({ id }) => id === selected);
};
export const selectedMovieTitle = (state: RootState) => state.movies.selected;

export default moviesSlice.reducer;
